  JCACCIA-BIRCH, Virginia Rose and FORTESCUE, Mark Charles Grenville (Billy.
  02> FORTESCUE, Clarissa Rose Frances
  b 18.02.1975
  Clarissa b. at Westminster, London. She was a student at St Mary's, Calne, Wiltshire, then
  graduated BA (Hons) from Bristol University in 1998.
  04> WILLIAMS, Paul Henry Metcalfe m on 01.09.1937 to SLOMAN, Ellen Dinah
  b 11.02.1908 d 15.08.1976
  b 23.09.1910
  Paul b, at Gisborne, m. at St Paul's Pro Cathedral, Wellington, d, and bd, at Havelock North. Dinah, d/o
  Willim Frederick Sloman and Esme Sommerville. Address: Apt 124, 57 Richard Farrell Avenue, Remuera,
  Auckland.
  Paul was involved with the family property at "Tangiwai", Wairoa before purchasing "Mangatawhiti" station,
  Ohuka, Wairoa in partnership with his brother, Michael. He was a graduate of the Greenwich Naval College
  and served as an officer with the RNZNVR during the war, mainly in the Indian/South East Asian theatre.
  Following the war he purchased "Wainui" at Puketapu where he lived until just before his death. Paul was
  for many years on the Hawkes Bay Royal Show Committee and served on other farmer-related bodies.
  01> WILLIAMS, Peter William m on 14.12.1965 to HOLDEN, Mary Louise Phyllis
  Gerard
  b 12.07.1938
  b 21.02.1944
  Peter b. at Gisborne and m. at Pukehou. Mary Lou, d/o Ralph Holden Wellwood
  Holden and Phyllis MacIndoe. Address: Waipoapoa Station, RD 12, Havelock
  North.
  Peter was educated at Hereworth School (1948-51) and Christ's College
  (1952-56). He worked on numerous farm properties including Homewood,
  Mangatawhiti and Mangaohane. He spent two years with the Territorial Army as a
  trooper NZSAS. Shortly after their marriage Peter and Mary-Lou went to manage Waipoapoa. In 1968 they
  purchased a half share of the property and have recently completed the purchase of the balance. Peter's
  interests include flying and golf.
  01> WILLIAMS, Kirsty Ruth m on 12.02.1994 to BARCLAY, Warren Ross
  b 16.12.1966
  b 23.04.1965
  Kirsty b. at Hastings and m. at Havelock North. Warren, s/o Ross Barclay and Margaret McGregor, b.
  at Gisborne. Address: 55 Marua Road, Ellerslie, Auckland.
  Kirsty was educated at Woodford House, Havelock North (1979-84) then attended Canterbury
  University. She worked in the travel industry and travelled extensively overseas for four years
  and works for the National Bank in electronic banking. She is currently on maternity leave and is
  setting up a picture framing business.
  Warren was educated at Gisborne Boys' High School and graduated BCom in Business Administration
  from the University of Canterbury. He has worked in the insurance industry in New Zealand and the
  freight industry in the United Kingdom and New Zealand and is currently the Marketing Manager for
  OHL New Zealand.
  01>
  BARCLAY, Nicholas Peter
  b 08.05.1997
  02> WILLIAMS, Susan Dinah
  b 09.11.1968
  Susan b. at Hastings. Address: 36 Gladstone Road, Parnell, Auckland.
  Susan graduated BSc from Auckland University. She spent two years overseas in Europe and London
  and is now working on contract in the computer industry.
